import React from 'react'
import './Sidebar.css'
import Logo from '../../imgs/logo.ico'

const Sidebar = () => {
  return (
    <div className="Sidebar">
      {/* logo */}
      <div className="logo">
        <img src={Logo} alt="#" />
        <span>
          Groo<span>Be</span>
        </span>
      </div>
    </div>
  )
}

export default Sidebar;
